import {
    UserGroupIcon,
    BellIcon,
    CogIcon,
    LogoutIcon,
  } from "@heroicons/react/outline";
  
  export default function Sidebar() {
    return (
      <aside className="w-64 bg-gray-900 text-gray-200 flex flex-col">
        <div className="px-6 py-8 flex items-center">
          <span className="text-2xl font-bold">âš¡ Ausgrid</span>
        </div>
        <nav className="flex-1 px-4 space-y-1">
          {[
            { name: "Dashboard", icon: HomeIcon },
            { name: "Consumers List", icon: UserGroupIcon },
            { name: "Alerts", icon: BellIcon },
            { name: "Profile", icon: CogIcon },
          ].map((item) => (
            <a
              key={item.name}
              href="#"
              className="flex items-center px-3 py-2 rounded hover:bg-gray-800"
            >
              <item.icon className="h-5 w-5 mr-3" />
              {item.name}
            </a>
          ))}
        </nav>
        <div className="px-4 pb-4">
          <button className="flex items-center w-full px-3 py-2 rounded hover:bg-gray-800">
            <LogoutIcon className="h-5 w-5 mr-3" />
            Logout
          </button>
        </div>
      </aside>
    );
  }
